def main():
    n = int(input())
    arr = []
    for i in range(n):
        l, r = map(int, input().split())
        arr.append([l, r])
    arr.sort()
    for i in range(n):
        for j in range(i + 1, n):
            if arr[i][0] >= arr[j][0] and arr[i][1] <= arr[j][1]:
                print(i + 1, j + 1)
                break
        else:
            print(-1, -1)


if __name__ == "__main__":
    main()




